import React from 'react'

function AllBooks(props) {
    return (
        <div style = {booksStyle} className = "all-books">
            <h4>{props.title}</h4>
        </div>
    )
}


const booksStyle = {
    border: "1px solid black",
    padding: "10px",
    textAlign: "center"
}



export default AllBooks;
